import React, { useState } from "react";
import axios from "axios";
import { Navigate } from "react-router-dom";
import { connect } from "react-redux";
import PropTypes from "prop-types";
import Footer from "../components/footer";
import { createGlobalStyle } from "styled-components";
import {
  isEmpty,
  isEmail,
  isMatch,
  isLength,
} from "../utils/validation/Validation";
import { Router, Location, Redirect } from "@reach/router";
import { useSelector } from "react-redux";

const GlobalStyles = createGlobalStyle`
  header#myHeader.navbar.sticky.white {
    background: #403f83;
    border-bottom: solid 1px #403f83;
  }
  header#myHeader.navbar .search #quick_search{
    color: #fff;
    background: rgba(255, 255, 255, .1);
  }
  header#myHeader.navbar.white .btn, .navbar.white a, .navbar.sticky.white a{
    color: #fff;
  }
  header#myHeader .dropdown-toggle::after{
    color: rgba(255, 255, 255, .5);
  }
  header#myHeader .logo .d-block{
    display: none !important;
  }
  header#myHeader .logo .d-none{
    display: block !important;
  }
  @media only screen and (max-width: 1199px) {
    .navbar{
      background: #403f83;
    }
    .navbar .menu-line, .navbar .menu-line1, .navbar .menu-line2{
      background: #fff;
    }
    .item-dropdown .dropdown a{
      color: #fff !important;
    }
  }
`;
const initialState = {
  name: "",
  email: "",
  username: "",
  phoneNo: "",
  password: "",
  password2: "",
};
function Register() {
  const auth = useSelector((state) => state.auth);
  console.log(auth);
  const { isLogged, isAdmin } = auth;

  const [user, setUser] = useState(initialState);
  console.log("isLogged: " + isLogged);
  const { name, email, password, password2, username, phoneNo } = user;

  const handleChangeInput = (e) => {
    const { name, value } = e.target;
    setUser({ ...user, [name]: value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    if (
      isEmpty(name) ||
      isEmpty(password) ||
      isEmpty(password2) ||
      isEmpty(email) ||
      isEmpty(phoneNo) ||
      isEmpty(username)
    ) {
      // setAlert("Please fill in all fields.", "danger");

      return setUser({
        ...user,
      });
    }
    if (!isEmail(email)) {
      // setAlert("Invalid email.", "danger");

      return setUser({ ...user });
    }
    if (isLength(password)) {
      // setAlert("Password must be at least 6 characters.", "danger");

      return setUser({
        ...user,
      });
    }
    if (!isMatch(password, password2)) {
      // setAlert("Passwords do not match", "danger");

      return setUser({ ...user, err: "Password did not match.", success: "" });
    }
    try {
      await axios.post("http://localhost:2190/user/register", {
        name,
        email,
        password,
        username,
        phoneNo,
      });
      setUser({ ...user });
      localStorage.setItem("firstLogin", true);
      dispatch(dispatchLogin());
      console.log("auth" + auth);
    } catch (err) {
      setUser({ ...user });
    }
  };
  if (isLogged) {
    console.log("inloggedddddd");
    return <Redirect to="/" />;
  }
  return (
    <div>
      <GlobalStyles />

      <section
        className="jumbotron breadcumb no-bg"
        style={{ backgroundImage: `url(${"./img/background/subheader.jpg"})` }}
      >
        <div className="mainbreadcumb">
          <div className="container">
            <div className="row">
              <div className="col-md-12 text-center">
                <h1>Register</h1>
                <p>Anim pariatur cliche reprehenderit</p>
              </div>
            </div>
          </div>
        </div>
      </section>

      <section className="container">
        <div className="row">
          <div className="col-md-8 offset-md-2">
            <h3>Don't have an account? Register now.</h3>
            <p>
              Sed ut perspiciatis unde omnis iste natus error sit voluptatem
              accusantium doloremque laudantium, totam rem aperiam, eaque ipsa
              quae ab illo inventore veritatis et quasi architecto beatae vitae
              dicta sunt explicabo.
            </p>

            <div className="spacer-10"></div>

            <form
              name="contactForm"
              id="contact_form"
              className="form-border"
              onSubmit={handleSubmit}
            >
              <div className="row">
                <div className="col-md-6">
                  <div className="field-set">
                    <label>Name:</label>
                    <input
                      type="text"
                      name="name"
                      id="name"
                      className="form-control"
                      value={name}
                      onChange={handleChangeInput}
                    />
                  </div>
                </div>

                <div className="col-md-6">
                  <div className="field-set">
                    <label>Email Address:</label>
                    <input
                      type="text"
                      name="email"
                      id="email"
                      className="form-control"
                      value={email}
                      onChange={handleChangeInput}
                    />
                  </div>
                </div>

                <div className="col-md-6">
                  <div className="field-set">
                    <label>Choose a Username:</label>
                    <input
                      type="text"
                      name="username"
                      id="username"
                      className="form-control"
                      value={username}
                      onChange={handleChangeInput}
                    />
                  </div>
                </div>

                <div className="col-md-6">
                  <div className="field-set">
                    <label>Phone:</label>
                    <input
                      type="text"
                      name="phoneNo"
                      id="phone"
                      className="form-control"
                      value={phoneNo}
                      onChange={handleChangeInput}
                    />
                  </div>
                </div>

                <div className="col-md-6">
                  <div className="field-set">
                    <label>Password:</label>
                    <input
                      type="text"
                      name="password"
                      id="password"
                      className="form-control"
                      value={password}
                      onChange={handleChangeInput}
                    />
                  </div>
                </div>

                <div className="col-md-6">
                  <div className="field-set">
                    <label>Re-enter Password:</label>
                    <input
                      type="text"
                      name="password2"
                      id="re-password"
                      className="form-control"
                      value={password2}
                      onChange={handleChangeInput}
                    />
                  </div>
                </div>

                <div className="col-md-12">
                  <div id="submit" className="pull-left">
                    <input
                      type="submit"
                      id="send_message"
                      value="Register Now"
                      className="btn btn-main color-2"
                    />
                  </div>

                  <div className="clearfix"></div>
                </div>
              </div>
            </form>
          </div>
        </div>
      </section>

      <Footer />
    </div>
  );
}
// export default Register;

// Register.propTypes = {
//   setAlert: PropTypes.func.isRequired,
//   isLogged: PropTypes.bool,
// };

// const mapStateToProps = (state) => ({
//   isLogged: state.auth.isAuthenticated,
// });
Register.propTypes = {
  setAlert: PropTypes.func.isRequired,
  auth: PropTypes.object.isRequired,
};

const mapStateToProps = (state) => ({
  auth: state.auth,
});

export default connect(mapStateToProps)(Register);
